import React from 'react'
import '../css/PausedPage.css'

const PausedPage = () => {

    return (
        <div className='pause__card'>
            <h3>GAME PAUSED</h3>
            <div className='actions'>
                <button>Resume</button>
                <button>New Game</button>
                <button>High Score</button>
                <button>Exit</button>
            </div>
        </div>
    )
}

export default PausedPage;
